public class TimeInfo {

    /**
     * 开始时间
     */
    private Long bgTime;

    /**
     * 结束时间
     */
    private Long endTime;

    public Long getBgTime() {
        return bgTime;
    }

    public void setBgTime(Long bgTime) {
        this.bgTime = bgTime;
    }

    public Long getEndTime() {
        return endTime;
    }

    public void setEndTime(Long endTime) {
        this.endTime = endTime;
    }

}
